import { CommentData } from './Application'
import React from 'react'

type PropsType = {
  commentData: CommentData[]
}

export const Comment = (props: PropsType) => {
  let comment = props.commentData.map(el => el.text)
  return (
    <div>
      <div>{comment}</div>
    </div>
  )
}
